import { Box, Flex, Image } from "@chakra-ui/react";
import logo from "../assets/logo.png";

const Sidebar = () =>{

    // Sidebar Menus

    const SideBarMenus = [
        {
            path: "/admin/dashboard",
            name: "Dashboard",
        },
        {
            path: "/admin/salesInfo",
            name: "SalesInfo",
        },
    ];

    return(
        <>
        <Box minHeight={"100vh"} bgColor={"black"} textColor={"white"} width={"200px"}>
            <Flex flexDir={"column"}>
                <Image src={logo} paddingLeft={"50px"}></Image>
            </Flex>
        </Box>
        </>
    )
};

export default Sidebar;
